const WineList = ({ wines, selectWine }) => {
  return (
    <div className="col s12 m6 l3">
      <h2 className="center-align">Wines</h2>
      <div className="collection">

        {/* {wines.map(({ wine }) => (
          <a href="#!" className="collection-item" key={wine.id} onClick={() => selectWine(wine.id)}>
          {wine.id}
          </a>
        ))} */}
        {wines.map(({ coffee, size }) => (
        <p key={coffee}>Coffee type {coffee.name} in a {size} size.</p>
      ))}

      </div>
    </div>

  )
}

export default WineList
